import numpy as np

# ### implementation of the compressibility sum-rule for the LFC computed from the parametrization by Groth et al [PRL 119 (13), 135001 (2017)]

PI = 3.141592653589793238462


# ### compute the density n from rs
def n(rs):
	return 3.0*0.25/np.pi / rs**3

# ### compute the Fermi wave number for spin-unpolarized system
def qf(rs):
	return np.power( 9*np.pi*0.25, 1.0/3.0 ) / rs




def Ef(rs):
	return qf(rs)*qf(rs)*0.5


def density(rs):
	return 3.0*0.25/PI / rs**3


def inverse_temperature(rs, t):
	return 1.0/(Ef(rs)*t)


