# ### This is actually the new, consistently T-dependent implementation.

def Groth_A(rs,t):
	n = density(rs)
	beta = inverse_temperature(rs, t)
	factor = double(n,beta)
	return -qf(rs)**2 / (4.0*np.pi) * factor
